2803887722080936828=<ph name="BEGIN_H3">Debugging Features<ph name="END_H3"><br>    <ph name="BR"><br>    You can enable the debugging features on your Chrome OS Device in order to install and test customised code on your device. This will allow you to:<ph name="BR"><br>    <ph name="BEGIN_LIST"><br>      <ph name="LIST_ITEM">Remove rootfs verification so that you can modify OS files<br>      <ph name="LIST_ITEM">Enable SSH access to the device using the standard test keys so you can use tools such as <ph name="BEGIN_CODE">&apos;cros flash&apos;<ph name="END_CODE"> to access the device<br>      <ph name="LIST_ITEM">Enable booting from USB so you can install an OS image from a USB drive<br>      <ph name="LIST_ITEM">Set both the dev and the system root log-in password to a customised value so that you can manually SSH into the device<br>    <ph name="END_LIST"><br>    <ph name="BR"><br>    Once enabled, most of the debugging features will remain enabled even after performing a powerwash or wiping the data on an enterprise-managed device. To fully disable all debugging features, complete the Chrome OS recovery process (https://support.google.com/chromebook/answer/1080595).<br>    <ph name="BR"><br>    <ph name="BR"><br>    For more information about the debugging features see:<ph name="BR"><br>    http://www.chromium.org/chromium-os/how-tos-and-troubleshooting/debugging-features<br>    <ph name="BR"><br>    <ph name="BR"><br>    <ph name="BEGIN_BOLD">Note:<ph name="END_BOLD">  The system will reboot during the process.</ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph>
